import Vue from 'vue'
import VueRouter from 'vue-router'
import LoginPage from "@/views/LoginPage";
import Main from "@/views/Main";
import Layout from "@/layout/Layout";
import gragh from '@/views/gragh'
import ranking from '@/views/ranking'

const Answer = () => import('@/views/AnswerCar');

Vue.use(VueRouter)

const routes = [
    {
        path: '/login',
        name: 'login',
        component: LoginPage
    },
    {
        path: '/',
        name: 'layout',
        component: Layout,
        redirect: '/main',
        children: [
            {
                path: '/main',
                name: 'Main',
                component: Main
            },
            {
                path: '/gragh',
                name: 'gragh',
                component: gragh
            },
            {
                path: '/answer',
                name: 'answer',
                component: Answer
            },
            {
                path: '/ranking',
                name: 'ranking',
                component: ranking
            }
        
        
        ]
    },
   
]

const router = new VueRouter({
    routes
})

export default router
